class AppState {
    constructor() {
        this.state = {
            username: "",
            password:""

        }
    }

    getCredeentials() {
        return this.state;
    }

    setCredentials(username, password) {
        this.state = {
            username: username,
            password: password
        }
    }
}
const AppInstance = new AppState();
export default AppInstance;
